use std::collections::HashMap;

pub fn min_steps_1(s: String, t: String) -> i32 {
    let mut s_count_map: HashMap<char, i32> = HashMap::new();
    for c in s.chars() {
        s_count_map.entry(c).and_modify(|v| *v += 1).or_insert(1);
    }

    // calc diff count
    for c in t.chars() {
        s_count_map.entry(c).and_modify(|v| *v -= 1).or_insert(-1);
    }

    let count = s_count_map.iter().fold(0, |acc, (_, v)| acc + v.abs());
    count / 2
}

pub fn min_steps(s: String, t: String) -> i32 {
    let mut count_vec = vec![0; 26];
    let s_array = s.as_bytes();
    let t_array = t.as_bytes();
    let start = 'a' as u8;
    for idx in 0..s.len() {
        count_vec[(s_array[idx]-start) as usize] += 1;
        count_vec[(t_array[idx]-start) as usize] -= 1;
    }
    count_vec.iter().fold(0, |acc, v| acc + (*v as i32).abs()) / 2
}

#[test]
fn test_one() {
    assert_eq!(1, min_steps("bab".to_string(), "aba".to_string()));
    assert_eq!(5, min_steps("leetcode".to_string(), "practice".to_string()));
    assert_eq!(0, min_steps("anagram".to_string(), "mangaar".to_string()));
    assert_eq!(0, min_steps("xxyyzz".to_string(), "xxyyzz".to_string()));
    assert_eq!(4, min_steps("friend".to_string(), "family".to_string()));
}

#[test]
fn test_two() {
    let s = "";
    let t = "";
    assert_eq!(min_steps(s.to_string(), t.to_string()), 68);
}

#[test]
fn test_three() {
    let s = "";
    let t = "";
    println!("{}", s.len());
    assert_eq!(min_steps(s.to_string(), t.to_string()), 494);
}
